column8:
■トヨタ車種 専用設計デュアルUSBポートパネル<br>
■適合車種：適合表をご確認ください。<br>
■2.1A×USB2ポート搭載/ブースター付き<br>
■LEDインジケーター搭載<br>

【スイッチパネル(ホールカバー)交換方法】<br>
１．スイッチパネルが付いているパネルを外し、裏側が見えるようにします<br>
(車種により方法は変わります)<br>
２．交換したいパネルの上下にある爪を押し込み、表側に押すと外れます。<br>
３．本製品をパネルの穴に同じように取り付けます。<br>
４．配線を接続したら完了です。<br><style type="text/css">
<!--
span.unit { background: url(https://image.rakuten.co.jp/groovy-gbt/cabinet/gry_outstyle/05576864/imgrc0075332759.jpg) no-repeat left top; text-indent:
