</style>
<div align="center">

<br>
</div>

●USBからUSB Type-C端子を持つスマートフォンやタブレットなどに充電やデータ転送が可能です。<br>●USB2.0仕様で480Mbpsのデータ通信、5V/3A出力に対応しています。<br>●USB Type-Cコネクタは、向きを気にせずに使えるリバーシブルコネクタを採用し、ストレスのない構造になっています。<br>●外部ノイズに強い２重シールド構造です。<br>●USB Type-Cコネクタには適切な抵抗値を内蔵した安全なケーブルです。（USB Type-C対応スマートフォンでの充電、通信テスト済み）<br>●車内の使用にも耐える耐熱素材被膜採用。サビに強く信号劣化の少ない金メッキピンを採用。<br><br>品番：D438<br>メーカー：セイワSEIWA<style type="text/css">
