■車のアクセサリーソケット電源から充電を行うことができる、<br>スマートフォン/タブレット用急速充電器です（micro USB充電端子用）。<br><BR>■Qualcomm Quick Charge 3.0規格に対応した機器を<br>最大18Wの高出力により短時間で充電できます。<br><BR>※Qualcomm Quick Charge 3.0規格に非対応の機器や旧規格対応の<br>機器に接続した場合でも、自動的に認識して最大の充電能力を発揮して充電します。<br><BR>■DC12/24V車対応です。（マイナスアース車に限る）<br><br><br>【仕様】<br><br>消費電力：最大18W<br>出力電圧/電流：DC3.6V～12V/1.4A～2A<br>コード長：1m<br>カラー：ブラック×メタルブルー<br><br>メーカー：セイワ<br>品番：D433<style type="text/css">
