●車のDCソケットをUSB電源に変換し、<br>車でスマートフォン/タブレット/iPhone/iPod等を快適に充電できます。<br><BR>●クアルコム社 クイックチャージ2.0認証品。<br><BR>●docomoの急速充電2、またはau/SoftBankのクイックチャージ2.0規格に対応した<br>端末に接続すると、最適な出力に自動的に切替え、<br>最大9V/1.8A出力または最大12V/1.35A出力の高出力で充電できます。<br><BR>●USBコネクタの表も裏も向きを気にせず挿せるリバーシブルUSBポート。<br><BR>●12V/24V車兼用。<br><BR>●通電確認用ブルーLEDランプ付。<BR>※USBケーブルは付いておりません。各機器の純正USBケーブルをご用意ください。<br><br>入力電圧：DC12V/24 マイナスアース車<br>出力：DC5V/2.1A(2100mA)<br>または DC9V/1.8A(1800mA)<br>または DC12V/1.35A(1350mA)<br><br>メーカー：カシムラ<br>品番：AJ-479<style type="text/css">
